Criswell Embroidery &amp; Design

830 Delicate K-Lace

Here&amp;#039;s a practical yet beautiful group of lace designs themed with paisleys and hearts. The elegant motifs and borders may be used to make arrangements fitted to common features of clothing, such as necklines, skirt slits, corners, borders and button plackets as shown above.

Several composite designs are included in dst format for big hoops. All are stitched with 40-wt rayon on water soluble stabilizer. 
